<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerForms/RouteTest/RouteTestExm&amp;amp;v=37x" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Dealer&amp;nbsp;Section&amp;nbsp;/&amp;nbsp;Dealer&amp;nbsp;Forms&amp;nbsp;/&amp;nbsp;Route&amp;nbsp;Test&amp;nbsp;/&amp;nbsp;Route&amp;nbsp;Test&amp;nbsp;Exm&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerForms/RouteTest/RouteTestExm&amp;amp;time=2007-06-26+18%3A30%3A43">2007-06-26 18:30:43&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerForms/RouteTest/RouteTestExm&amp;amp;time=2007-07-05+12%3A00%3A58">2007-07-05 12:00:58&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Необходимо посмотреть маршрутизацию на&amp;nbsp;направление Turks and&amp;nbsp;Caicos Islands код&amp;nbsp;1649 от&amp;nbsp;оригинатора «Operator 1», следует выполнить действия:&lt;br />
&lt;ol type="1">&lt;li> В&amp;nbsp;поле «Select site» необходимо выбрать оригинирующего оператора &amp;ndash; «Operator 1»; 
&lt;/li>&lt;li> В&amp;nbsp;поле «Select MERA servers» следует выбрать один из&amp;nbsp;MVTS-серверов, прописанных в&amp;nbsp;системе; 
&lt;/li>&lt;li> В&amp;nbsp;поле «Enter destination number» необходимо ввести начальные цифры кода направления &amp;ndash; 1649; 
&lt;/li>&lt;li> В&amp;nbsp;поле «Route limit» ввести количество выводимых маршрутов;
&lt;/li>&lt;li> Нажать кнопку «Show route». &lt;/li>&lt;/ol>
См.&amp;nbsp;рис.:&lt;br />
&lt;img src="http://78.46.73.113/wiki/files/primer14.png" alt=" (10&amp;nbsp;Кб)" title=" (10&amp;nbsp;Кб)" width='674' height='656' />&lt;/div>&lt;br />
